INSERT INTO `craft_matrixcontent_introduction` VALUES (1,941,1,'2019-06-19 09:31:15','2019-06-19 10:45:42','127160e1-a166-4e38-9454-f1fca430277d','We care deeply about our work, and those we make it with and for. The process of design is rarely linear, and we believe that the best thinking comes to life through a liberated, investigative, hands-on process of making. For us, the ingredient that connects thinking and making is an understanding of craft.'),(2,942,1,'2019-06-19 09:31:15','2019-06-19 10:45:42','93a1477b-586e-496d-80cb-aa6c55ead947','The old idea of architects as master builders is newly pertinent. Our job is to make buildings that read as well close up as they do from far away. This only happens if the architecture is informed by the practicalities of how a building goes together and we orchestrate the many skills need to achieve this. It’s only with craft in its making that the finished building retains the integrity of the original idea.');
