INSERT INTO `craft_matrixcontent_process` VALUES (1,944,1,'2019-06-19 09:50:32','2019-06-19 10:45:42','39e4fd97-60b6-4091-af89-e5e7ef0036f6','Being there','Understanding the context of a project isn’t just about first sight; it relies on spending time with a place – and a client. We begin by putting our wellies on, walking the site in different conditions to get a feel for its atmosphere, microclimate and topography before we begin thinking about how we can interpret these characteristics.'),(2,949,1,'2019-06-19 09:53:28','2019-06-19 10:45:43','6fa1d845-24e8-4262-b363-ba909da6f505','Getting our hands dirty','Developing a design is never a simple thing.  The initial fragment of an idea may come easily, but it’s a hands-on process – as physical as it is thoughtful – that shapes it into something that really sings. It takes tenacity and often a shared drawing, sketched and over-sketched until that happy moment when everything aligns.'),(3,950,1,'2019-06-19 09:53:28','2019-06-19 10:45:43','3cca037a-441a-4be7-bfdb-0a150cddf776','Permission to build','Getting approval for a design is an essential part of the making process, but often the most challenging. By treating the authorities, heritage groups and broader community like clients right from the start, their official ‘permission to build’ can be gained more smoothly – a critical step in bringing a project to life.'),(4,951,1,'2019-06-19 09:53:28','2019-06-19 10:45:43','4f3bf897-1a40-4692-ae33-94aef28b7809','Informed details','Our hands-on experience has shown us that the most robust and authentic details are those which are thought out from the point of view of the person who will build them. By listening to the builder, to understand how they will approach the project, we can ensure clarity in the detailed information we produce.'),(5,952,1,'2019-06-19 09:53:28','2019-06-19 10:45:43','06b09d57-8579-4d49-96f8-9f2d7cf78b08','Being there, still','We want to see our projects though, to close the circle. We see it as a professional duty of care to our clients to protect their interests until the work is fully complete, keeping a hands-on connection and advising on specific aspects of the construction when our expertise is needed.');
/*!40000 ALTER TABLE `craft_matrixcontent_process` ENABLE KEYS */;
UNLOCK TABLES;
commit;

